INSERT INTO public.games (id, category_id, name, description, instructions, icon_url, banner_url, is_active, is_pro_only, recommended_rounds)
VALUES
('memory_matrix', 'memory', 'Memory Matrix', 'Test and improve your visual working memory by remembering patterns on a grid.', 'A grid of tiles will briefly light up in a pattern. Memorize the pattern before it disappears. When the grid resets, tap the tiles that were highlighted. Patterns become larger and more complex as you progress.', 'https://rvpbpvbzmtwkmbcxegmg.supabase.co/storage/v1/object/public/game-assets/memory-matrix-game-square.png', 'https://rvpbpvbzmtwkmbcxegmg.supabase.co/storage/v1/object/public/game-assets/memory_matrix_game.jpg', true, false, 3),
('mental_arithmetic', 'math', 'Mental Arithmetic', 'Solve math problems quickly and accurately using only mental calculation.', 'You will be shown a math problem. Calculate the answer mentally and select or enter the correct result. Answer as quickly and accurately as possible. Difficulty and speed increase over time.', 'https://rvpbpvbzmtwkmbcxegmg.supabase.co/storage/v1/object/public/game-assets/mental-arithmetic-game-square.png', 'https://rvpbpvbzmtwkmbcxegmg.supabase.co/storage/v1/object/public/game-assets/mental_arithmetic_game.jpg', true, false, 8),
('mental_language_discrimination', 'language', 'Language Discrimination', 'Improve language precision by choosing the correct word or phrase in context.', 'You will see a sentence with a missing word or phrase. Select the option that best completes the sentence. Pay attention to grammar, meaning, and subtle differences between choices.', 'https://rvpbpvbzmtwkmbcxegmg.supabase.co/storage/v1/object/public/game-assets/mental-language-discrimination-game-square.png', 'https://rvpbpvbzmtwkmbcxegmg.supabase.co/storage/v1/object/public/game-assets/mental-language-discrimination-game.jpg', true, false, 8),
('wordle', 'language', 'Wordle', 'Guess the hidden word by using letter clues from each attempt.', 'You have a limited number of guesses to find the secret word. After each guess, letters will be highlighted: green means correct position, yellow means the letter exists but in a different position, and gray means the letter is not in the word.', 'https://rvpbpvbzmtwkmbcxegmg.supabase.co/storage/v1/object/public/game-assets/wordle-game-square.png', 'https://rvpbpvbzmtwkmbcxegmg.supabase.co/storage/v1/object/public/game-assets/wordle-game.jpg', true, false, 1),
('ball_sort', 'attention', 'Ball Sort', 'Sort all matching colorful balls into their own tubes using strategic moves.
